import React from "react";
import Rotulo from "../components/Rotulo"
import ContentBanhoTosa from "../components/ContentBanhoTosa";

const BanhoTosa = () => {
	return (
		<div>
			<Rotulo rotulo='Banho e Tosa' />
			<ContentBanhoTosa />
		</div>
	);
};

export default BanhoTosa;
